package com.oopspractice;

public class MultipleAttribute {
	
	String name1="Aatif";
	String name2="Khan";
	int age = 25;

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		MultipleAttribute obj = new MultipleAttribute();
		System.out.println("Name : "+obj.name1+" "+obj.name2);
		System.out.println("Age : "+obj.age);
	}

}
